void HAL_DAC_ConvHalfCpltCallbackCh1(DAC_HandleTypeDef* hdac)
{
	uint16_t i=0;
//	BSP_LED_ON();
	while(i!=1000)
	{
		DAC12Buf[i] = (SinWave[Wave_sum1>>22]<<16)|(SinWave[Wave_sum2>>22]);
		Wave_sum1 += Wave_tick1;
		Wave_sum2 += Wave_tick2;
		i++;
		DAC12Buf[i] = (SinWave[Wave_sum1>>22]<<16)|(SinWave[Wave_sum2>>22]);
		Wave_sum1 += Wave_tick1;
		Wave_sum2 += Wave_tick2;
		i++;
		DAC12Buf[i] = (SinWave[Wave_sum1>>22]<<16)|(SinWave[Wave_sum2>>22]);
		Wave_sum1 += Wave_tick1;
		Wave_sum2 += Wave_tick2;
		i++;
		DAC12Buf[i] = (SinWave[Wave_sum1>>22]<<16)|(SinWave[Wave_sum2>>22]);
		Wave_sum1 += Wave_tick1;
		Wave_sum2 += Wave_tick2;
		i++;
		DAC12Buf[i] = (SinWave[Wave_sum1>>22]<<16)|(SinWave[Wave_sum2>>22]);
		Wave_sum1 += Wave_tick1;
		Wave_sum2 += Wave_tick2;
		i++;
	}
//	BSP_LED_OFF();
}
