/*-------------------------------------------------------
功能	: 初始化DAC12
输入	: void
返回	: void
Copyright : yitiandelan.
---------------------------------------------------------*/
void BSP_DAC_Init(void)
{
	DAC_ChannelConfTypeDef sConfig;
	TIM_MasterConfigTypeDef sMasterConfig;

	__DMA1_CLK_ENABLE();
	__GPIOA_CLK_ENABLE();
	
#if (configUSE_DDS == 1)
	/* if use dds-core,enable dma1 stream5 nvic */
	HAL_NVIC_SetPriority(DMA1_Stream5_IRQn, 0, 0);
	HAL_NVIC_EnableIRQ(DMA1_Stream5_IRQn);
#endif
	
	/**DAC Initialization 
	*/
	hdac.Instance = DAC;
	HAL_DAC_Init(&hdac);

	/**DAC channel OUT1 config 
	*/
	sConfig.DAC_Trigger = DAC_TRIGGER_T6_TRGO;
	sConfig.DAC_OutputBuffer = DAC_OUTPUTBUFFER_ENABLE;
	HAL_DAC_ConfigChannel(&hdac, &sConfig, DAC_CHANNEL_1);

	/**DAC channel OUT2 config 
	*/
	HAL_DAC_ConfigChannel(&hdac, &sConfig, DAC_CHANNEL_2);
	
	htim6.Instance = TIM6;
	htim6.Init.Prescaler = 1-1;
	htim6.Init.CounterMode = TIM_COUNTERMODE_UP;
	htim6.Init.Period = 36-1;
	HAL_TIM_Base_Init(&htim6);

	sMasterConfig.MasterOutputTrigger = TIM_TRGO_UPDATE;
	sMasterConfig.MasterSlaveMode = TIM_MASTERSLAVEMODE_DISABLE;
	HAL_TIMEx_MasterConfigSynchronization(&htim6, &sMasterConfig);
	
	
	HAL_DAC_Start_DMA(&hdac,DAC_CHANNEL_1,(uint32_t*)DAC12Buf,2000,DAC_ALIGN_12B_R);
	
	// for dac ch2
	//{
	__HAL_DAC_ENABLE(&hdac, DAC_CHANNEL_2);
	
	__HAL_DMA_DISABLE(&hdma_dac1);
	hdma_dac1.Instance->PAR = (uint32_t)&DAC->DHR12RD;
	__HAL_DMA_ENABLE(&hdma_dac1);
	//}
	
	HAL_TIM_Base_Start(&htim6);
}
